import React from 'react'
import { Link } from 'react-router-dom'

const Welcome = () => {
  return (
    <div className='w-full h-full'>
      {/* Welcome Header */}
      <div className='bg-gradient-to-r from-green-600 to-green-800 text-white py-8 px-4'>
        <div className='max-w-6xl mx-auto'>
          <h1 className='text-4xl font-bold mb-2'>Welcome Back to KrishiAI</h1>
          <p className='text-green-100'>Your AI-powered agricultural assistant is ready to help</p>
        </div>
      </div>
    </div>
  )
}

export default Welcome
